  value: '<p><b>Règle sur la date de début des abonnements</b><br></p><ul><li> <span
    style="font-size: 1.6rem; line-height: 2.4rem;">Si vous êtes un nouvel utilisateur
    - i.e aucune  formation d''enregistrée sur le site - votre abonnement débutera
    à la date de réservation de votre première  formation.</span><br></li><li><span
    style="font-size: 1.6rem; line-height: 2.4rem;">Si vous avez déjà une  formation
    ou plus de validée, votre abonnement débutera à la date de votre achat d''abonnement.</span></li>
    </ul><p>Merci de bien prendre ses informations en compte, et merci de votre compréhension.
    L''équipe du Fab Lab.<br> </p><p></p>'
